  imports: [ToggleSwitchModule, ReactiveFormsModule, FormsModule, CommonModule],
  templateUrl: './toggle-switch.component.html',
  styleUrl: './toggle-switch.component.scss',
  providers: [
    {
      provide: NG_VALUE_ACCESSOR,
      useExisting: forwardRef(() => ToggleSwitchComponent),
      multi: true,
    },
  ],
})
export class ToggleSwitchComponent implements ToggleSwitchProps {
  @Input() formControlName: string | null = null;
  @Input() disabled = false;
  @Input() iconOn?: string = 'pi-check';
  @Input() iconOff?: string = 'pi-times';
  @Input() invalid = false;
  @Input() label?: string;
  @Input() labelPosition = 'right';
  @Input() styleClass?: string;
  @Input() errorMessage?: string;
  @Input() required?: boolean;

  id = `input-${Math.random().toString(36).substr(2, 9)}`;

  private _value = false;
  touched = false;

  @Input()
  get value(): boolean {
    return this._value;
  }
  set value(val: boolean) {
    this._value = val;
    this.onChange(val);
    this.onTouched();
  }

  onChange: (value: boolean) => void = () => {};
  onTouched = () => {
    this.touched = true;
  };

  writeValue(value: boolean): void {
    this._value = value;
  }

  registerOnChange(fn: (value: boolean) => void): void {
    this.onChange = fn;
  }

  registerOnTouched(fn: () => void): void {
    this.onTouched = fn;
  }

  setDisabledState(isDisabled: boolean): void {
    this.disabled = isDisabled;
  }

  onInput(value: boolean): void {
    this.value = value;
  }
}

